In fact, if Keyple create a background Thread it should be marked as "daemon".
For example
```java
private final ExecutorService executorService = Executors.newSingleThreadExecutor(runnable -> {
    final Thread thread = new Thread(runnable, "keyple");
    thread.setDaemon(true);
    return thread;
});
```
Could replace https://github.com/eclipse/keyple-java/blob/eadf16071f8b59bb481c20456437f53950050d5b/java/component/keyple-plugin/pcsc/src/main/java/org/eclipse/keyple/plugin/pcsc/PcscReaderImpl.java#L65

This could permit to an application to exit without having to shutdown the executor.

By this way, I will be forced to have to wait before exiting my main thread.

Hello zemoa,
Thank you for your interest in Keyple.
Unfortunately the high level API to handle this type of operations with the SAM is under development and will not be available in the very short term.
However, it is possible to perform the unlocking of the SAM using the low level commands as shown below :

```
            // create an apdu request list to handle SAM command
            List<ApduRequest> apduRequests = new ArrayList<ApduRequest>();

            final String UNLOCK_DATA = "00112233445566778899AABBCCDDEEFF";

            // create a request with the Unlock command builder
            apduRequests.add(new UnlockCmdBuild(SamRevision.C1, ByteArrayUtil.fromHex(UNLOCK_DATA))
                    .getApduRequest());

            SeRequest seRequest = new SeRequest(apduRequests);

            SeResponse seResponse = ((ProxyReader) samResource.getSeReader())
                    .transmitSeRequest(seRequest, ChannelControl.KEEP_OPEN);

            if (seResponse.getApduResponses().get(0).getStatusCode() != 0x9000) {
                System.out.println("The SAM unlocking failed!");
            } else {
                System.out.println("The SAM unlocking was successful!");
            }
```
You should be able to implement your own method to unlock the SAM.
Feel free to keep us informed.
